import React from 'react';
import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

import ComponentHeader  from './components/Header';
import ComponentFooter  from './components/Footer';
import ComponentHome  from './components/Home';

function App() {
  return (
    <div className="App">
    <BrowserRouter>
    <Routes>

      <ComponentHeader />

        <Route path="/">
          <ComponentHome />
        </Route>


      <ComponentFooter />
      </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
